  classifier: function(wifiList){
    console.log('classifying',wifiList)
    var errorList=wifiInfo.map(function(elem){
      return elem.map(function(e){
        for (var i=0;i<wifiList.length;i++){
          if(e.id==wifiList[i].id){
            return 100.0/(Math.abs(e.strength-wifiList[i].strength)+0.1)
          }
        }
        return 0
      })
    })
    console.log(errorList)
    var error=errorList.map(function(elem){
      return elem.reduce(function (pre, cur) { return pre + cur }) //sum
    })
    const max = error.reduce(function (pre, cur) { return Math.max(pre, cur) })
    console.log(error,max)
    var wifiLocaition=error.indexOf(max)
    if (max==0){
      return undefined
    }
    else{
      return wifiLocaition
    }
  },
  test: function(){
    wx.getWifiList({
      success: function (res) {
        console.log(res)
      }
    })
    var that=this
    wx.onGetWifiList(function (res) {
      console.log(res.wifiList)
      if (res.wifiList.length) {
        var list = res.wifiList.map(function (elem) {
          return {
            id: elem.BSSID,
            strength: elem.signalStrength
          }
        })
        var result = that.classifier(list)
        var output='can\'t match'
        if (typeof(result)!==undefined){
          output = (result + 1).toString()
        }
        wx.showToast({
          title: output,
          icon: 'succes',
          duration: 1000,
          mask: true
        })
      }
    })

  },
